(22677, 22611, '2016-07-05 00:00:00', 1, '2016-07-05 00:00:00', 8701, 5642, 'solicitação da ana paula'),
(22197, 19244, '2016-06-28 00:00:00', 1, '2016-06-29 00:00:00', 8701, 5642, 'O PN ANTERIOR (3032967-000) FOI DESCONTINUADO PELO FORNECEDOR (EATON).\r\nA SOLICITAÇÃO DA EDIÇÃO DO CADASTRO VEIO DO LEANDRO SILVEIRA.'),
(22766, 22763, '2016-07-07 00:00:00', 1, '2016-07-07 00:00:00', 651, 5642, 'chapa para uso no canopy'),
(22737, 22388, '2016-07-06 00:00:00', 1, '2016-07-07 00:00:00', 8701, 5642, 'Celso O CADASTRO DESTE ITEM ESTA SENDO ATUALIZADO E SERÁ TAMBÉM INCLUIDO MAIS DOIS ITENS NO MATERIAL MASTER, O CANOPY FRONTAL E O BLAST PROTECTOR, CONFORME E-MAIL ENVIADO PELO RUI EM 05/07/2016'),
(23089, 17485, '2016-07-19 00:00:00', 1, '2016-07-20 00:00:00', 8701, 5642, 'pn alterado, de acordo com informação do fornecedor.\r\nantes era 7343-1 e agora assumi 7343-2.'),
(22980, 18221, '2016-07-13 00:00:00', 1, '2016-07-13 00:00:00', 8701, 5642, 'Celso, a solicitação foi feita pelo Luciano santos, que recebeu a atualização do pn do fornecedor.'),
(23088, 17485, '2016-07-19 00:00:00', 1, '2016-07-26 00:00:00', 8701, 17594, 'pn alterado, de acordo com informação do fornecedor.\r\nantes era 7343-1 e agora assumi 7343-2.'),
(23143, 20737, '2016-07-20 00:00:00', 1, '2016-07-20 00:00:00', 8701, 5642, 'ALterado na descrição de p1 para p2, conforme solicitação do marcio bernardo.'),
(24381, 24122, '2016-08-05 00:00:00', 1, '2016-08-05 00:00:00', 5642, 5625, 'CORMER? SERIA CORNER?'),
(23757, 18171, '2016-07-26 00:00:00', 1, '2016-07-28 00:00:00', 851, 5642, 'pn ATUALIZADO DE ACORDO INFORMAÇÃO DO FORNECEDOR.'),
(24382, 24117, '2016-08-05 00:00:00', 1, '2016-08-05 00:00:00', 5642, 5625, 'CORNER'),
(23843, 23109, '2016-07-28 00:00:00', 1, '2016-07-28 00:00:00', 8701, 5642, 'item cadastrado errado.\r\nO correto é ser buy, bushing.'),
